import React, { useState, useEffect } from 'react';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';
import Link from 'next/link';

export default function () {
  const logo = css`
    font-size: 30px;
    color: #ffff;
    margin-left: 20px;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
    background: #f26968;
    font-family: 'Julius Sans One', sans-serif;
    padding: 20px;
  `;

  const app = css`
    background: #f26968;
    min-height: 100vh;
    font-weight: 400;
    font-family: 'sans-serif';
    width: 100%;
    position: absolute;
  `;

  const mainTitle = css`
    color: #ffff;
    font-family: 'Julius Sans One', sans-serif;
    text-align: center;
    letter-spacing: 0.1em;
  `;

  const readyToGo = css`
    color: #ffff;
    font-size: 20px;
    text-decoration: none;
    font-family: 'Julius Sans One', sans-serif;
  `;
  const [restaurant, setAllRestaurants] = useState([]);

  // fetching data

  useEffect(() => {
    fetch(
      '/api/3/action/package_show?id=f365dfc2-6d70-4725-a6e0-a5e478c1f79f',
      {
        headers: { 'Content-Type': 'application/json' },
      },
    )
      .then((res) => res.json())
      .then((data) => {
        const restaurantData = Object.values(data);
        setAllRestaurants(restaurantData);
      })
      .catch((e) => console.log(e));
  }, []);
  console.log(restaurant);

  return (
    <>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Muli&display=swap');
      </style>
      <div css={app}>
        <Link href={'/index'}>
          <a href="#a" css={logo}>
            Wolfi
          </a>
        </Link>
        <h1 css={mainTitle}>Get your plan here</h1>
        <div></div>
        <div>
          <Link href={'/readyToGo'}>
            <a href="#a" css={readyToGo}>
              Get your plan! &#x0226B;
            </a>
          </Link>
        </div>
      </div>
    </>
  );
}
